import React, { useState } from 'react';
import { Text, StyleSheet,View, Button, TextInput, Image} from "react-native";
import { styles } from '../Style/style';



const image = { uri: "https://gifman.net/wp-content/uploads/2019/06/ursinhos-fofos-coracoes.gif" }

export default function Dados({navigation}){

    const [dados, setDados] = useState({
        agencia:'',
        contaCorrente:''
    });
    return (
        <View style={styles.dados}>

            <View>
            <Image source={require('../../img/logo.png')}/>
            </View>
           
            <Text style={styles.dadosText}>Bem Vindo a sua conta SoulMili</Text>

            <Text style={styles.dadosText1}>{`\nAgência Bancária: ${dados.agencia}`}</Text>

            <Text>{`\nConta: ${dados.contaCorrente}`}</Text>

            <TextInput style={styles.dadosTextInput} placeholder='Digite sua agência' defaultValue={dados.agencia} onChangeText={(valor) => setDados ({...dados, agencia:valor})}/>

            
            <TextInput style={styles.dadosTextInput}  placeholder='Digite sua Conta' defaultValue={dados.contaCorrente} onChangeText={(valor) => setDados ({...dados, contaCorrente:valor})}/>
            
        </View>
    )
}
